import { MessageService } from '@/services/message.service';
import { RuleConfig } from '@/constants/course/rule';
export default {
  serviceInject: function serviceInject() {
    return {
      messageService: MessageService,
      ruleConfig: RuleConfig
    };
  },
  data: function data() {
    return {
      form: this.$form.createForm(this)
    };
  },
  methods: {
    save: function save() {
      var _this = this;

      this.form.validateFields().then(function () {
        _this.messageService.success({
          content: '提交成功'
        });
      });
    }
  }
};
